import { Link } from "react-router-dom";
import courses from "../data/courses";

const Courses = () => {
  return <>
  <h1>Courses</h1>;
  {courses.map((course) => <Link to={`courses/${course.slug}`}>{}</Link>)}
  </>
};

export default Courses;
